import React from 'react'
import {BrowserRouter,Route,Router} from 'react-router-dom'
import Home from './pages/Home'
function App() {
  return (
    <BrowserRouter>

      <Router>
        <Route path="/"
          element={<Home />}
        />
      </Router>
    </BrowserRouter>
  )
}

export default App
